-- ----------------------------
-- Table structure for `t_city`
-- ----------------------------
DROP TABLE IF EXISTS `t_city`;
CREATE TABLE `t_city` (
`city_id`  varchar(6) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '城市ID' ,
`province_id`  varchar(6) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '省ID' ,
`city_name`  varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '城市名称' ,
`flag`  int(1) NOT NULL DEFAULT 2 COMMENT '标识(1=直辖市；2=地级市；3=县级市)' ,
`remark`  varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注' ,
PRIMARY KEY (`city_id`),
FOREIGN KEY (`province_id`) REFERENCES `t_province` (`province_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `idx_city_ref_province` (`province_id`) USING BTREE ,
INDEX `idx_flag` (`flag`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8mb4 COLLATE=utf8mb4_general_ci
COMMENT='市'

;

